const tf = mm.tf;

const wfc = function(T, P) {
  let states = tf.ones([T, P, N], 'bool').arraySync(); // Lazy way of filling an array with ones :)

  const push_entropic_neighbors = function(set, t, p) {
    if(t > 0   && d3.sum(states[t-1][p]) > 1) set.push([t-1, p]);
    if(t < T-1 && d3.sum(states[t+1][p]) > 1) set.push([t+1, p]);
    if(p > 0   && d3.sum(states[t][p-1]) > 1) set.push([t, p-1]);
    if(p < P-1 && d3.sum(states[t][p+1]) > 1) set.push([t, p+1]);
  };

  let dirty = [];
  for(let t = 0; t < T; t++) {
    for(let p = 0; p < P; p++) {
      dirty.push([t, p])
    }
  }

  for(let iteration = 0; iteration < T * P; iteration++) {
    while(dirty.length > 0) {
      // Propagate constraints
      let new_dirty = [];
      for(let [t, p] of dirty) {
        const remaining = states[t][p];
        let remaining_new = states[t][p];
        if(t > 0) {
          const previous = states[t-1][p];
          remaining_new = remaining_new.map((c, i) => c && previous.map((p, j) => p && temporal_mask[j][i]).some(x => x));
        }
        if(t < T-1) {
          const next = states[t+1][p];
          remaining_new = remaining_new.map((c, i) => c && next.map((n, j) => n && temporal_mask[i][j]).some(x => x));
        }
        for(let p2 = 0; p2 < p; p2++) {
          const lower = states[t][p2];
          remaining_new = remaining_new.map((c, i) => c && lower.map((l, j) => l && local_mask[j][i]).some(x => x));
        }
        for(let p2 = p+1; p2 < P-1; p2++) {
          const upper = states[t][p2];
          remaining_new = remaining_new.map((c, i) => c && upper.map((u, j) => u && local_mask[i][j]).some(x => x));
        }

        if(d3.sum(remaining_new) < d3.sum(remaining)) {
          push_entropic_neighbors(new_dirty, t, p);
          states[t][p] = remaining_new;
        }
      }
      dirty = util.stringified_unique(new_dirty);
    }

    // Collapse state
    const entropies = [];
    for(let t = 0; t < T; t++) {
      for(let p = 0; p < P; p++) {
        if(d3.sum(states[t][p]) > 1) {
          entropies.push([t, p, d3.sum(states[t][p].map((e, i) => e ? probs[i] : 0))]);
        }
      }
    }
    if(entropies.length === 0) {
      continue;
    }
    const [[collapse_t, collapse_p, total_entropy], ] = util.argmin(entropies, x => x[2]);
    const probabilities = states[collapse_t][collapse_p].map((e, i) => e ? probs[i] / total_entropy : 0);
    let rand = Math.random();
    let idx = 0;
    while(rand > 0 && idx < N) {
      rand -= probabilities[idx];
      idx++;
    }
    idx--;
    
    for(let i = 0; i < N; i++) {
      states[collapse_t][collapse_p][i] = i == (idx ? 1 : 0);
      push_entropic_neighbors(dirty, collapse_t, collapse_p);
    }
  }

  // Expand the tiles
  let pianoroll = []
  for(let p = 0; p < P; p++) {
    let pitch_rhythm = [];
    for(let t = 0; t < T; t++) {
      let still_needs_to_push = true;
      for(let i = 0; i < N; i++) {
        if(states[t][p][i]) {
          pitch_rhythm = pitch_rhythm.concat(tiles[i]);
          still_needs_to_push = false;
          break;
        }
      }
      if(still_needs_to_push) {
        pitch_rhythm = pitch_rhythm.concat(tiles[0]);
      }
    }
    pianoroll.push(pitch_rhythm);
  }

  return pianoroll;
}

export { wfc };
